<html lang="en">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1" />
<title>US County Housing — Cartopy Globe</title>
<style>
  :root{ 
    --ring: #4a5568; 
    --text: #1a1a1a; 
    --muted: #666666; 
    --bg: #f5f5f7; 
    --glass: rgba(255,255,255,0.25);
    --glass-border: rgba(255,255,255,0.4);
  }
  html,body{height:100%; margin:0; background: #f5f5f7;}
  body{font-family: 'Inter', 'SF Pro Display', system-ui, -apple-system, sans-serif; color:var(--text); overflow:hidden;}

  .control-panel{
    position:fixed; left:20px; top:20px; z-index:10; 
    background: var(--glass); border: 1px solid var(--glass-border); backdrop-filter: blur(30px) saturate(200%);
    box-shadow: 0 8px 32px rgba(0,0,0,0.1), 0 1px 0 rgba(255,255,255,0.6) inset, 0 -1px 0 rgba(0,0,0,0.1) inset; 
    border-radius: 16px; padding: 20px; 
    width: 280px; max-height: 80vh; overflow-y: auto;
  }
  
  .control-panel .section{ margin-bottom: 20px; }
  .control-panel .section:last-child{ margin-bottom: 0; }
  
  .control-panel .legend-section .legend-title{ font-weight:700; margin-bottom:8px; color:var(--text); }
  .control-panel .legend-section .bar{height:12px; border-radius:8px; margin:8px 0;}
  .control-panel .legend-section .minmax{display:flex; justify-content:space-between; color:var(--muted); font-size:12px;}
  
  .control-panel .controls-section label{font-size:13px; color:var(--muted); margin-right:8px; font-weight:500; display:block; margin-bottom:4px;}
  .control-panel .controls-section select,.control-panel .controls-section button{ 
    background: rgba(255,255,255,0.3); color:var(--text); border: 1px solid rgba(255,255,255,0.4);
    border-radius: 10px; padding: 10px 16px; width:100%; outline:none; 
    font-size: 13px; font-weight: 500; transition: all 0.3s ease; backdrop-filter: blur(15px);
    margin-bottom: 12px;
  }
   .control-panel .controls-section select[multiple]{
     min-height: 80px; max-height: 120px; overflow-y: auto;
   }
  .control-panel .controls-section select:hover, .control-panel .controls-section button:hover {
    background: rgba(255,255,255,0.4); border-color: rgba(255,255,255,0.6); transform: translateY(-1px);
  }
  .control-panel .controls-section button {
    background: rgba(142,142,147,0.9);
    border: none; color: white; font-weight: 600; box-shadow: 0 2px 8px rgba(0,122,255,0.3);
  }
  .control-panel .controls-section button:hover {
    background: rgba(99,99,102,0.9);
    transform: translateY(-1px); box-shadow: 0 4px 12px rgba(0,122,255,0.4);
  }
  .control-panel .period{ color:var(--muted); font-size:13px; font-weight:500; }
  
  .control-panel .selected-section .pin-header{ font-weight:700; margin-bottom:12px; color:var(--text); letter-spacing:.02em }
  .control-panel .selected-section .pin-item{ border:1px solid rgba(255,255,255,0.4); border-radius:12px; padding:12px 14px; margin:8px 0; background:rgba(255,255,255,0.2); backdrop-filter: blur(15px); transition: all 0.3s ease; }
  .control-panel .selected-section .pin-item:hover{ background:rgba(255,255,255,0.3); transform: translateY(-1px); }
  .control-panel .selected-section .pin-title{ font-weight:700; color:var(--text); }
  .control-panel .selected-section .pin-sub{ color:var(--muted); font-size:12px; }

  #globe{ position:fixed; inset:0; background: transparent; }

  .err{position:fixed; right:20px; bottom:20px; background:#7f1d1d; color:#fee2e2; padding:12px 16px; border-radius:12px; font-size:13px; border:1px solid #ef4444; box-shadow: 0 8px 32px rgba(0,0,0,0.1);}
</style>
</head>
<body>
  <div class="control-panel">
    <!-- 图例部分 -->
    <div class="section legend-section">
      <div id="legend-title" class="legend-title"></div>
      <div class="bar" id="legend-bar"></div>
      <div class="minmax"><span id="legend-min">-</span><span id="legend-max">-</span></div>
    </div>
    
    <!-- 控制部分 -->
    <div class="section controls-section">
      <label for="metric">Metric:</label>
      <select id="metric"></select>
      
       <label for="states">State:</label>
       <select id="states" multiple></select>
      
      <button id="resetSel">Reset Selection</button>
      
      <div id="period" class="period"></div>
    </div>
    
    <!-- 选中县部分 -->
    <div class="section selected-section">
      <div id="pinned" style="display:none"></div>
    </div>
  </div>

  <div id="globe"></div>

  <script src="https://unpkg.com/three@0.164.1/build/three.min.js"></script>
  <script src="https://unpkg.com/globe.gl@2.34.5/dist/globe.gl.min.js"></script>
  <script src="https://unpkg.com/topojson-client@3"></script>

  <script>
  (function(){
    function showErr(msg){ console.error(msg); const el=document.createElement('div'); el.className='err'; el.textContent=msg; document.body.appendChild(el); setTimeout(()=>el.remove(), 8000); }
    function updateDebug(msg){ console.log('DEBUG:', msg); }

    // UI refs
    const elGlobe = document.getElementById('globe');
    const metricSel = document.getElementById('metric');
    const statesSel = document.getElementById('states');
    const periodEl  = document.getElementById('period');
    const resetBtn  = document.getElementById('resetSel');
    const legendTitle = document.getElementById('legend-title');
    const legendMin = document.getElementById('legend-min');
    const legendMax = document.getElementById('legend-max');
    const legendBar = document.getElementById('legend-bar');
    const pinnedEl  = document.getElementById('pinned');
    
    // Multi-select refs removed - using standard HTML select now

    // Data
    let rows, PERIOD, COUNTIES_TOPO, worldLand;
    try {
      rows = JSON.parse(document.getElementById('values-json').textContent || "[]");
      PERIOD = JSON.parse(document.getElementById('period-json').textContent || '"Latest"');
      COUNTIES_TOPO = JSON.parse(document.getElementById('counties-topo').textContent || "{}");
      worldLand = JSON.parse(document.getElementById('world-land').textContent || "{}");
      updateDebug(`Data loaded: ${rows.length} rows, period: ${PERIOD}, ${worldLand.features ? worldLand.features.length : 0} land features`);
    } catch(e) {
      showErr('Failed to parse embedded data: ' + e);
      updateDebug('Data parsing failed');
      return;
    }

    if (!rows.length){ showErr('county_values_latest.json is missing or empty'); return; }
    if (!COUNTIES_TOPO.objects || !COUNTIES_TOPO.objects.counties){ showErr('Invalid counties topojson structure'); return; }

    // Multi-select functionality removed - using standard HTML select now

    // Populate selectors
    const metrics = rows.length ? Object.keys(rows[0]).filter(k => !["FIPS","REGION","STATE_CODE"].includes(k)) : [];
    metricSel.innerHTML = '';
    metrics.forEach(m => metricSel.append(new Option(m.replaceAll('_',' ').toUpperCase(), m)));
    if (metrics.length) metricSel.value = metrics.includes('MEDIAN_DOM') ? 'MEDIAN_DOM' : metrics[0];

    // Initialize states selector
    const allStates = Array.from(new Set(rows.map(r=>r.STATE_CODE))).sort();
    statesSel.innerHTML = ''; statesSel.append(new Option('(All)', '(All)'));
    allStates.forEach(s => statesSel.append(new Option(s, s)));
    if (statesSel.options.length) statesSel.options[0].selected = true;

    periodEl.textContent = rows.length ? `Period: ${PERIOD}` : '';

    // Theme & state
      const THEME = {
        PALETTE: ['#f7fbff','#deebf7','#c6dbef','#9ecae1','#6baed6','#4292c6','#2171b5','#084594'],
        ACCENT:  'rgba(0,122,255,0.8)',
        HOVER:   'rgba(255,255,255,0.8)',
      STROKE_SELECTED: 'rgba(0,122,255,0.9)',
      STROKE_HOVER:    'rgba(0,122,255,0.7)',
      ALT_HOVER_MULT:  1.6,
      ALT_SELECT_MULT: 2.2,
      LABEL_BG:    'rgba(255,255,255,0.25)',
      LABEL_BORDER:'1px solid rgba(255,255,255,0.4)',
      LABEL_TEXT:  '#1a1a1a'
    };
    let countiesGeo = null;
    let hoverId = null;
    const selectedFips = new Set();

    // Utils
    const pad5 = s => String(s).padStart(5,'0');
    function quantile(sorted,p){ return sorted.length? sorted[Math.floor((sorted.length-1)*p)] : NaN; }
    function fmtVal(metric, v){
      const n = Number(v);
      if (!Number.isFinite(n)) return 'No data';
      if (metric.includes('PRICE') || metric.includes('PPSF')) return `$${n.toLocaleString()}`;
      if (metric === 'MEDIAN_DOM') return `${Math.round(n)} days`;
      if (["AVG_SALE_TO_LIST","SOLD_ABOVE_LIST","PRICE_DROPS","OFF_MARKET_IN_TWO_WEEKS"].includes(metric)) return `${(n*100).toFixed(1)}%`;
      return n.toLocaleString();
    }

    // Globe init
    const globe = Globe()(elGlobe)
      .backgroundColor('rgba(0,0,0,0)')
      .width(window.innerWidth)
      .height(window.innerHeight)
      .pointOfView({ lat: 38, lng: -98, altitude: 1.5 });

    // Set globe properties for cartopy globe
    setTimeout(() => {
      updateDebug('Setting cartopy globe...');
      globe
        .globeImageUrl(null)
        .bumpImageUrl(null)
        .showAtmosphere(false)
        .showGraticules(true)
        .graticulesColor('rgba(255,255,255,0.3)');
    }, 500);

    setTimeout(() => {
      updateDebug('Setting transparent material...');
      // 设置球体材质
      const mat = globe.globeMaterial();
      mat.transparent = true;
      mat.opacity = 0;
      mat.depthWrite = false;
      
      globe
        .polygonsTransitionDuration(400)
        .polygonCapColor(d => d.__baseColor || 'rgba(255,255,255,0.3)')
        .polygonSideColor(d => d.__baseColor || 'rgba(255,255,255,0.3)')
        .polygonStrokeColor('rgba(255,255,255,0.4)')
        .polygonAltitude(0.01)
        .polygonLabel(f => f.isLand ? null : (f.__label || `County ${f.id}`));
    }, 1000);

    window.addEventListener('resize', () => {
      globe.width(window.innerWidth).height(window.innerHeight);
    });

    // Data loading
    function loadCounties(){
      try{
        updateDebug('Starting county loading...');
        updateDebug('Converting topojson...');
        countiesGeo = topojson.feature(COUNTIES_TOPO, COUNTIES_TOPO.objects.counties);
        if (!countiesGeo.features.length) { showErr('No county features found'); return; }
        updateDebug(`Counties converted: ${countiesGeo.features.length} features`);
        updateGlobe();
      }catch(e){
        showErr('Failed to convert topojson: ' + e);
        updateDebug('TopoJSON conversion failed: ' + e);
      }
    }

    function updateGlobe(){
      if (!countiesGeo || !rows.length || !metrics.length) {
        updateDebug('Missing data for globe update');
        return;
      }

      const metric = metricSel.value;
      const chosen = Array.from(statesSel.selectedOptions).map(o=>o.value);
      const all = chosen.includes('(All)');

      const byFips = {};
      rows.forEach(r => { byFips[pad5(r.FIPS)] = r; });

      const vals = rows.filter(r => all || chosen.includes(r.STATE_CODE))
                       .map(r => Number(r[metric]))
                       .filter(Number.isFinite)
                       .sort((a,b)=>a-b);

      if (vals.length === 0) {
        updateDebug('No valid values for current selection');
        return;
      }

      const vmin = quantile(vals, 0.05);
      const vmax = quantile(vals, 0.95);
      const norm = v => (v - vmin) / (vmax - vmin || 1);

      const feats = countiesGeo.features.filter(f => {
        const rec = byFips[pad5(f.id)];
        return !!rec && (all || chosen.includes(rec.STATE_CODE));
      }).map(f => {
        const rec = byFips[pad5(f.id)];
        const v   = Number(rec?.[metric]);
        const county = rec?.REGION ?? f.properties?.name ?? 'N/A';
        const state  = rec?.STATE_CODE ?? '';
        const valFmt = fmtVal(metric, v);

        const altData = 0.015;

        f.__metric = metric;
        f.__value  = valFmt;
        f.__county = county;
        f.__state  = state;
        // 将十六进制颜色转换为RGBA格式，添加透明度
        const colorIndex = Number.isFinite(v) ? Math.min(7, Math.floor(norm(v) * 8)) : 0;
        const baseColor = THEME.PALETTE[colorIndex];
        if (baseColor && baseColor.startsWith('#')) {
          const hex = baseColor.replace('#', '');
          const r = parseInt(hex.substr(0, 2), 16);
          const g = parseInt(hex.substr(2, 2), 16);
          const b = parseInt(hex.substr(4, 2), 16);
          f.__baseColor = `rgba(${r}, ${g}, ${b}, 0.7)`;
        } else {
          f.__baseColor = 'rgba(255,255,255,0.1)';
        }
        f.__altBase  = altData;
        f.__label = `<div style="background:${THEME.LABEL_BG}; border:${THEME.LABEL_BORDER}; box-shadow:0 8px 32px rgba(0,0,0,0.1), 0 1px 0 rgba(255,255,255,0.6) inset; padding:12px 16px; border-radius:12px; font:13px/1.4 Inter,system-ui,Arial; color:${THEME.LABEL_TEXT}; letter-spacing:.02em; backdrop-filter: blur(30px) saturate(200%);">
          <b>${county}</b><br>${state} — ${valFmt}<br><span style="color:#666666; font-size:11px;">${PERIOD} • ${metric.replaceAll('_',' ').toUpperCase()}</span>
        </div>`;
        return f;
      });

      // 添加陆地边界数据
      let allPolygons = [...feats];
      if (worldLand && worldLand.features) {
        const landPolygons = worldLand.features.map(f => ({
          ...f,
          value: null,
          fips: null,
          isLand: true,
          __label: null  // 陆地不显示标签
        }));
        allPolygons = [...feats, ...landPolygons];
        updateDebug(`Added ${landPolygons.length} land polygons`);
      }
      
      updateDebug(`Updating globe with ${allPolygons.length} features`);
      globe.polygonsData(allPolygons);
      refreshStyles();

      // Legend
      legendTitle.textContent = metric.replaceAll('_',' ').toUpperCase();
      legendBar.style.background = `linear-gradient(90deg, ${THEME.PALETTE.join(',')})`;
      legendMin.textContent = Number.isFinite(vmin) ? fmtVal(metric, vmin) : '-';
      legendMax.textContent = Number.isFinite(vmax) ? fmtVal(metric, vmax) : '-';
    }

    function refreshStyles(){
      globe
        .polygonCapColor(d => {
          if (d.isLand) return 'rgba(255,255,255,0.3)'; // 陆地颜色
          if (selectedFips.has(d.id)) return d.__baseColor || 'rgba(255,255,255,0.3)'; // 选中时使用原色
          if (hoverId === d.id) return THEME.HOVER; // 悬停时使用蓝色高亮
          return d.__baseColor || 'rgba(255,255,255,0.3)';
        })
        .polygonSideColor(d => {
          if (d.isLand) return 'rgba(255,255,255,0.3)'; // 陆地颜色
          if (selectedFips.has(d.id)) return d.__baseColor || 'rgba(255,255,255,0.3)'; // 选中时使用原色
          if (hoverId === d.id) return THEME.HOVER; // 悬停时使用蓝色高亮
          return d.__baseColor || 'rgba(255,255,255,0.3)';
        })
        .polygonStrokeColor(d => {
          if (d.isLand) return 'rgba(0,0,0,0)'; // 陆地边界线颜色
          return 'transparent'; // 县数据不显示边框
        })
        .polygonAltitude(d => {
          if (d.isLand) return 0.005; // 陆地高度
          const a = d.__altBase || 0.015;
          if (selectedFips.has(d.id)) return a * THEME.ALT_SELECT_MULT;
          if (hoverId === d.id) return a; // 悬停县不抬升，只高亮
          return a;
        });
    }

    // 交互
    function renderPinnedPanel(){
      if (!selectedFips.size){ pinnedEl.style.display='none'; pinnedEl.innerHTML=''; return; }
      const byId = {}; (globe.polygonsData()||[]).forEach(f=>{ if(!f.isLand) byId[f.id] = f; });
      const items = Array.from(selectedFips).map(id => {
        const f = byId[id]; if(!f) return '';
        return `<div class="pin-item"><div class="pin-title">${f.__county}</div><div class="pin-sub">${f.__state} — ${f.__value}</div></div>`;
      }).join('');
      pinnedEl.innerHTML = `<div class="pin-header">Selected Counties (${selectedFips.size})</div>${items}`;
      pinnedEl.style.display = 'block';
    }

    globe.onPolygonHover(f => {
      hoverId = (f && !f.isLand) ? f.id : null;
      refreshStyles();
    });

    globe.onPolygonClick(f => {
      if(!f || f.isLand) return;
      if (selectedFips.has(f.id)) selectedFips.delete(f.id);
      else selectedFips.add(f.id);
      refreshStyles();
      renderPinnedPanel();
    });

    metricSel.addEventListener('change', updateGlobe);
    statesSel.addEventListener('change', updateGlobe);
    resetBtn.addEventListener('click', () => { selectedFips.clear(); refreshStyles(); renderPinnedPanel(); });

    // 启动
    loadCounties();
  })();
  </script>
</body>
</html>
